function splitString(str : string) {
    const words = str.split(' ');
    if (words.length > 3) {
        const firstPart = words.slice(0, 3).join(' ');
        const secondPart = words.slice(3).join(' ');
        return { firstPart, secondPart };
    } else {
        return { firstPart: str, secondPart: '' };
    }
  }

